import React, { useState } from 'react';


function Pagination(props) {
    const {pagination} = props;
    const [pagi, setPagi] = useState(pagination);
    const element = [];
    const onHandleClick = (i) => {
        setPagi({...pagi, page: i});
        console.log(pagi.page);
    }
    for(let i = 1; i <= Math.ceil(pagi.total/pagi.limit); i++){
        element.push(
            <li 
                className = {i === pagi.page ? "not-active" : ""}
                key = {i}
                onClick = {() => onHandleClick(i)}
                >{i}</li>
        );
    }
    return (
            <ul className = "pagination">
                <li className = {(pagi.page <= 1 ? "enable" : "")}>Pre</li>
                {element}
                <li className = {(pagi.page >= (Math.ceil(pagi.total/pagi.limit) ) ? "enable" : "")}>Next</li>
            </ul>
    );
}

export default Pagination;
